import {
    Button,
    Layout,
    Page,
    Form,
    TextField
} from '@shopify/polaris';


class Login extends React.Component {
    
    render() {
        return (
            <Page>
                <Layout>
                    <Form>
                        <TextField
                            value={username}
                            onChange={handleEmailChange}
                            label="User Name"
                            type="text"
                        />
                    </Form>
                </Layout>
            </Page>
        );
    }
}

export default Login;
